<!DOCTYPE html>
<html>
<head>
    <title>FLYING PLANE</title>
<style type="text/css">
        body {
            font-family: 'MS Reference Sans Serif';
            background-color: skyblue;
            margin: 0;
            padding: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
        }

        .table-container {
            background-color: #fff;
            padding: 20px;
            border-radius: 5px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.2);
        }

        .table {
            width: 100%;
            border-collapse: collapse;
        }

            /* Tablo başlığı stilleri */
            .table th {
                background-color: #333;
                color: #fff;
                font-weight: bold;
                padding: 10px;
                text-align: left;
                border: 1px solid black;
                padding: 10px;
            }

            /* Tablo hücreleri stilleri */
            .table td {
                border: 1px solid black;
                padding: 10px;
            }

        /* Responsive tablo stil */
        .table-responsive {
            overflow-x: auto;
        }

        /* Çizgili (striped) tablo */
        .table-striped tbody tr:nth-child(old) {
            background-color: #f2f2f2;
        }

        /* Fare üzerine gelindiğinde vurgulanan hücreler */
        .table-hover tbody td:hover {
            background-color: #5ca6f6;
        }

        /* Kenarlıklı (bordered) tablo */
        .table-bordered {
            border: 1px solid #ddd;
        }

        /* Tablo renk stil */
        .table-primary th,
        .table-primary td {
            background-color: #4a94e4;
            color: #fff;
        }

            position: absolute;
            top: 50%;
            left: 50%;

            text-align: center;
            background-color: azure;
            padding: 0px;
            border-radius: 6px;
        }

        .menuTitle {
            font-size: 32px;
            color: maroon;
            font-family: 'MS Reference Sans Serif';
            font-weight: bold;

		function yuksekskor() {
            var name = "plnwrsscr=";
            var ca = document.cookie.split(';');
            for (var i = 0; i < ca.length; i++) {
                var c = ca[i];
                while (c.charAt(0) == ' ') {
                    c = c.substring(1);
                }
                if (c.indexOf(name) == 0) {
                    name = c.substring(name.length, c.length);
                }
            }

            yskor = (name == "" || name == undefined || name == "plnwrsscr=" ? 0 : parseInt(name));
        }

        function boyutuGuncelle() {
            var canvas = document.getElementById("oyun-canvas");
            var canvasWidth = window.innerWidth - 5; // Yatay boyut
            var canvasHeight = window.innerHeight - 5; // Dikey boyut

            canvas.width = canvasWidth;
            canvas.height = canvasHeight;

            // Canvas'ı ekranda ortala
            canvas.style.position = "absolute";
            canvas.style.left = "1px";
            canvas.style.top = "1px";

            gameCanvasContainer.style.position = "absolute";
            gameCanvasContainer.style.left = canvas.style.left;
            gameCanvasContainer.style.top = canvas.style.top;

            gameCanvasContainer.width = canvas.width;
            gameCanvasContainer.height = canvas.height;
    		window.scrollbars.visible = false;
        }

        function menudur() {
            menuContainer.style.visibility = "visible";
            oyunbitti.style.visibility = "hidden";
            gameCanvasContainer.style.visibility = "hidden";
            document.getElementById("oyun-canvas").style.visibility = "hidden";
        }

		{
			tip  = 0;
			menuContainer.style.visibility = "hidden";
            oyunbitti.style.visibility = "visible";
            gameCanvasContainer.style.visibility = "hidden";
            document.getElementById("oyun-canvas").style.visibility = "hidden";
		}

        function Oyna(t) {
            tip = t;
			sonsure = 6;	
            menuContainer.style.visibility = "hidden";
            oyunbitti.style.visibility = "hidden";
            gameCanvasContainer.style.visibility = "visible";
            document.getElementById("oyun-canvas").style.visibility = "visible";

				uldizlar.forEach(u => u.aci = 0);
			}
			
			if (oyuncu1 != undefined)
			{
				let 				 p = 0;
				oyuncu1.x 			 = 250;
				oyuncu1.y 			 = canvas.height / 2;
				p					 = oyuncu1.en / 17;
			}
        }
		
	function verial(name, url) 
	{
		if (!url) url = window.location.href;
		name = name.replace(/[\[\]]/g, "\\$&");
		var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
		if (!results) return null;
		if (!results[2]) return '';
		return decodeURIComponent(results[2].replace(/\+/g, " "));
	}

	var tusdurum = false;
	var tusindex = 0;
  function updateGamepad(gamepadIndex) {
  requestAnimationFrame(function() {
    var gamepad = navigator.getGamepads()[gamepadIndex];
	
	if (tip === 0)
	{
		if (Math.round(gamepad.axes[1]) > 0 && tusdurum === false)
		{
			if (tusindex === 0)
			{
				tusindex = 1;
				playButton.focus();
				playButton.style.backgroundImage = "url(" + b2 + ")";
				aboutButton.style.backgroundImage = "url(" + b1 + ")";
				exitButton.style.backgroundImage = "url(" + b1 + ")";
			}
			else if(tusindex === 1)
			{
				tusindex = 2;
				aboutButton.focus();
				playButton.style.backgroundImage = "url(" + b1 + ")";
				aboutButton.style.backgroundImage = "url(" + b2 + ")";
				exitButton.style.backgroundImage = "url(" + b1 + ")";
			}
			else if(tusindex === 2)
			{
				tusindex = 3;
				exitButton.focus();
				playButton.style.backgroundImage = "url(" + b1 + ")";
				aboutButton.style.backgroundImage = "url(" + b1 + ")";
				exitButton.style.backgroundImage = "url(" + b2 + ")";
			}
			else
			{
				tusindex = 0;
			}
			
			tusdurum = true;
		}
		else if (Math.round(gamepad.axes[1]) === 0 && tusdurum === true) 
		{
			tusdurum = false;
		}
		
		if (gamepad.buttons[0].pressed)
		{
			if (tusindex === 1)
			{
				tusindex = 0;
				tusdurum = false;
				playButton.click();	
			}
			else if (tusindex === 2)
			{
				tusindex = 0;
				tusdurum = false;
				aboutButton.click();	
			}
			else if (tusindex === 3)
			{
				tusindex = 0;
				tusdurum = false;
				exitButton.click();	
			}			
		}
		else if (gamepad.buttons[2].pressed || gamepad.buttons[8].pressed)
		{
			window.close();
			window.history.back();
		}
	}
	else if(oyunbitti.style.visibility === "visible")
	{
		if (Math.round(gamepad.axes[1]) > 0 && tusdurum === false)
		{
			if (tusindex === 0)
			{
				tusindex = 1;
				btnreplay.focus();
				btnreplay.style.backgroundImage = "url('" + b2 + "')";
				btnmainmenu.style.backgroundImage = "url('" + b1 + "')";
			}

				btnmainmenu.focus();
				btnreplay.style.backgroundImage = "url('" + b1 + "')";

	}

		function handleOrientation(event)
		{
            // Cihazın yatay eğim değerini kullanarak hareketi belirle
            var tilt = event.gamma; // Yatay eğim

            // Hareket sınırlarını belirle (isteğe bağlı)
            var minTilt = -30;
            var maxTilt = 800;

            // Hareket miktarını belirle
            var movement = 7;

            // Yatay eğimi kullanarak oyuncu karakterini hareket ettir
            playerPosition += tilt * 0.1; // Daha yumuşak bir hareket için bir katsayı ekleyebilirsiniz

            // Hareket sınırlarını kontrol et
            playerPosition = Math.max(minTilt, Math.min(maxTilt, playerPosition));
        }
	

function handleTouchMove(event) 
{
    let currentTouchX = event.touches[0].clientX;
	let currentTouchY = event.touches[0].clientY;
    let deltaX = currentTouchX - startTouchX;
	let deltaY = currentTouchY - startTouchY;
	
	if (deltaY > 0 && oyuncu1.y + oyuncu1.boy < canvas.height)
	{
		oyuncu1.y += 8;
	}
	else if (deltaY < 0 && oyuncu1.y > 0)
	{
		oyuncu1.y -= 8;
	}
	
    startTouchX = currentTouchX;
	startTouchY = currentTouchY;

    event.preventDefault();
}

function handleTouchStart(event) 
{
    startTouchX = event.touches[0].clientX;
	startTouchY = event.touches[0].clientY;
    
	dokunkare.x = startTouchX;
	dokunkare.y = startTouchY;
	
	if (carpma(dokunkare, btnsol) == true)
	{
		tuslar["ArrowLeft"] = true;
	}
	else if (carpma(dokunkare, btnsag) == true)
	{
		tuslar["ArrowRight"] = true;
	}
		
	if (carpma(dokunkare, btngaz) == true)
	{
		tuslar["ArrowUp"] = true;
	}	

		if (carpma(dokunkare, btnates) == true)
		{
			play(sesler.ates);
			tuslar["Control"] = true;
		}
				
    clearInterval(tusintid);
    event.preventDefault();
}

	
	function handleTouchEnd(event) 
	{
		if (carpma(dokunkare, btnsol) == true)
		{
			tuslar["ArrowLeft"] = false;
		}

			tuslar["ArrowRight"] = false;
		}
		
		if (carpma(dokunkare, btngaz) == true)
		{
			tuslar["ArrowUp"] = false;
		}	
	
		if (carpma(dokunkare, btnates) == true)
		{
			tuslar["Control"] = false;
		}
		
		event.preventDefault();
    }

		function carpma(rect1, rect2) 
		{
            return (
                rect1.x < rect2.x + rect2.en &&
                rect1.x + rect1.en > rect2.x &&
                rect1.y < rect2.y + rect2.boy &&
                rect1.y + rect1.boy > rect2.y
            );
        }

        function rnd(min, max) 
		{
			let sayi = 0;
            min = Math.ceil(min);
            max = Math.floor(max);
			sayi = Math.floor(Math.random() * (max - min)) + min;
			console.log("rast = " + sayi.toString());
            return sayi;
        }
	
	
	function play(ses, dongu)
{
    let blob = new Blob([ses], { type: 'audio/wav' });
    let url = URL.createObjectURL(blob);
    let audio = new Audio(url);

    if (dongu == true)
	{
		audio.addEventListener('ended', function() { audio.currentTime = 0; audio.play(); });
	}
	
    audio.play();
    
    if (dongu == undefined || dongu != true)
	{
		audio.addEventListener('ended', function() { URL.revokeObjectURL(url); });
	}
}

	function Guncelle()
	{  
		if (uldizlar != undefined && ustkaya != undefined && altkaya != undefined)
		{
			if (uldizlar.length > 0 && ustkaya.length > 0 && altkaya.length > 0)
			{
			
				uldizlar.forEach(u =>
				{
					if (u.x < -20)
					{
						u.x = rnd(1500, 10000);
						u.gorunme = true;
					}
					
					ustkaya.forEach(i =>
					{
						if (i.x < -50)
						{
							i.x = rnd(2000, 200000);
						}
						
						if (carpma(u, i) == true && i.gorunme == true && u.gorunme ==  true)
						{
							u.y =i.y + i.boy + 55;
						}
					});
					
					altkaya.forEach(a =>
					{
						if (a.x < -50)
						{
							a.x = rnd(2000, 200000);
						}
						
						if (carpma(u, a) == true && a.gorunme == true && u.gorunme ==  true)
						{
							u.y = a.y - 100;
						}
					});
				});
				
				
			}
		}
	
		if (oyuncu1 != undefined)
		{			
			if (sure < sonsure)
			{
				sure++;
			}
			else
			{
				sure = 0;
				if (oyuncu1.gorunme == true)
				{
					hizX--;
				}
				else
				{
					Oyun_Bitti();
				}
			}
						
		}
	}
	
	
	function Ciz()
	{
		ctx.clearRect(0, 0, canvas.width, canvas.height);
		
		if (tip > 0)
		{
		if (alist != undefined)
		{
			if (alist.length > 0)
			{
				for (let i = 0; i<alist.length; i++)
				{	
					alist[i].x += hizX;
					zlist[i].x += hizX;
					ctx.drawImage(arkaplanimg, alist[i].x, alist[i].y, alist[i].en, alist[i].boy);
					if (altkaya != undefined && ustkaya != undefined)
					{
						if (altkaya.length > 0 && ustkaya.length > 0)
						{
							for (let x = 0; x<altkaya.length; x++)
							{
								altkaya[x].en  = altkaya[x].resim.width;
								altkaya[x].boy = canvas.height / 2;
								ustkaya[x].en  = ustkaya[x].resim.width;
								ustkaya[x].boy = canvas.height / 2;
								
								ctx.drawImage(ustkaya[x].resim, ustkaya[x].x, ustkaya[x].y, ustkaya[x].en, ustkaya[x].boy);
								ctx.drawImage(altkaya[x].resim, altkaya[x].x, altkaya[x].y, altkaya[x].en, altkaya[x].boy);
							}
						}
					}
					ctx.drawImage(zeminimg, zlist[i].x, zlist[i].y, zlist[i].en, zlist[i].boy);
				}
				
				if (altkaya != undefined && ustkaya != undefined)
				{
					if (altkaya.length > 0 && ustkaya.length > 0)
					{		
						altkaya.forEach(i => i.x += hizX);
						ustkaya.forEach(i => i.x += hizX);
					}
				}	
				
				if (alist[0].x + alist[0].en < 0)
				{
					alist[0].x = alist[2].x + alist[2].en;
					zlist[0].x = zlist[2].x + zlist[2].en;
				}
				else if (alist[1].x + alist[1].en < 0)
				{
					alist[1].x = alist[0].x + alist[0].en;
					zlist[1].x = zlist[0].x + zlist[0].en;
				}
				else if (alist[2].x + alist[2].en < 0)
				{
					alist[2].x = alist[1].x + alist[1].en;
					zlist[2].x = zlist[1].x + zlist[1].en;
				}
			}
		}
		
		if (uldizlar != undefined && oyuncu1 != undefined)
		{
			if (uldizlar.length > 0)
			{
				for (let u = 0; u<uldizlar.length; u++)
				{
					if (uldizlar[u].aci < 7500)
					{
						uldizlar[u].aci += 1;
					}
					else
					{
						uldizlar[u].aci = 0;
					}
					
					if (carpma(uldizlar[u], oyuncu1) == true && oyuncu1.gorunme == true && uldizlar[u].gorunme == true)
					{
						play(sesler.al);
						uldizlar[u].gorunme = false;
						if (isiltiefc != undefined)
						{
							if (isiltiefc.length > 0)
							{
								for (let i = 0; i<isiltiefc.length; i++)
								{
									if (isiltiefc[i].gorunme == false) 
									{
										isiltiefc[i].gorunme = true
										isiltiefc[i].x = uldizlar[u].x - 10;
										isiltiefc[i].y = uldizlar[u].y - 10;
										break;
									}
								}
							}
						}
						skor.puan++;
					}
					
					if (uldizlar[u].gorunme == true)
					{
					uldizlar[u].x += hizX;
					ctx.save();
					ctx.translate(uldizlar[u].x, uldizlar[u].y);
					ctx.rotate(uldizlar[u].aci * Math.PI / 120);
					ctx.drawImage(uldizlar[u].resim, -uldizlar[u].resim.width / 2, -uldizlar[u].resim.height / 2);
					ctx.restore();
					}
				}
			}
		}
		
		if (oyuncu1 != undefined && ucakimgs != undefined)
		{
			if (oyuncu1.gorunme == true)
			{
			if (tuslar["ArrowUp"] == true)
			{
				oyuncu1.y -= oyuncu1.hizY;
			}
			else if (tuslar["ArrowDown"] == true)
			{
				oyuncu1.y += oyuncu1.hizY;
			}
					
			oyuncu1.en  =	oyuncu1.resim[oyuncu1.syc].width;
			oyuncu1.boy =	oyuncu1.resim[oyuncu1.syc].height;
			if (oyuncu1.sure < oyuncu1.sonsure)
			{
				oyuncu1.sure++;
			}
			else
			{
				oyuncu1.sure = 0;
				if (oyuncu1.syc < oyuncu1.resim.length - 1)
				{
					oyuncu1.syc++;
				}
				else
				{
					oyuncu1.syc = 0;
				}
			}
			
			if (altkaya != undefined && ustkaya != undefined)
			{
				if (altkaya.length > 0 && ustkaya.length > 0)
				{
					altkaya.forEach(i =>
					{
						i.kapsam   = new Kare(i.x - 140, i.y + i.boy, i.en + 140 , 100);
						if (carpma(i, oyuncu1) == true)
						{
							play(sesler.patla);
							patlat.gorunme = true;
							patlat.x = oyuncu1.x;
							patlat.y = oyuncu1.y;
							hizX = 0;
							//oyuncu1.x = i.x + 5;
							oyuncu1.gorunme = false;
							sonsure = 3;
							lblsonuc.innerText = "SKOR = " + skor.puan.toString();
						}
					});
					
					ustkaya.forEach(i =>
					{
						i.kapsam   = new Kare(i.x - 140, i.y + i.boy, i.en + 140 , 100);
						if (carpma(i, oyuncu1) == true)
						{
							play(sesler.patla);
							patlat.gorunme = true;
							patlat.x = oyuncu1.x;
							patlat.y = oyuncu1.y;
							hizX = 0;
							//oyuncu1.x = i.x + 5;
							sonsure = 3;
							oyuncu1.gorunme = false;
							lblsonuc.innerText = "SKOR = " + skor.puan.toString();
						}
					});
				}
			}
			
			ctx.drawImage(oyuncu1.resim[oyuncu1.syc], oyuncu1.x, oyuncu1.y, oyuncu1.en, oyuncu1.boy);
			}
		}
	
		if (patlat != undefined)
		{
			if (patlat.gorunme == true)
			{
			if (patlat.sure < patlat.sonsure)
			{
				patlat.sure++;
			}
			else
			{
				patlat.sure = 0;
				if (patlat.resno < patlat.resims.length - 1)
				{
					patlat.resno++;
				}
				else
				{
					patlat.resno = 0;
					patlat.gorunme = false;
				}
			}
				patlat.en  = patlat.resims[patlat.resno].width;
				patlat.boy = patlat.resims[patlat.resno].height;
				ctx.drawImage(patlat.resims[patlat.resno], patlat.x, patlat.y, patlat.en, patlat.boy);
			}
		}
		
		if (isiltiefc != undefined)
		{
			if (isiltiefc.length > 0)
			{
				for (let i = 0; i<isiltiefc.length; i++)
				{
					if (isiltiefc[i].gorunme == true)
					{
					if (isiltiefc[i].sure 	 < isiltiefc[i].sonsure)
					{
						isiltiefc[i].sure++;
					}
					else
					{
						isiltiefc[i].sure = 0;
						if (isiltiefc[i].resno < isiltiefc[i].resims.length - 1)
						{
							isiltiefc[i].resno++;
						}
						else
						{
							isiltiefc[i].resno = 0;
							isiltiefc[i].gorunme = false;
						}
					}
						
						isiltiefc[i].en  = 50;
						isiltiefc[i].boy = 50;
						ctx.drawImage(isiltiefc[i].resims[isiltiefc[i].resno], isiltiefc[i].x, isiltiefc[i].y, isiltiefc[i].en, isiltiefc[i].boy);
					}
				}
			}
		}
		
		if (sayilarimgs != undefined)
		{
			if (sayilarimgs.length > 0)
			{
				if (skor.puan.toString().length == 1)
				{
					ctx.drawImage(sayilarimgs[skor.puan], 55, 55, sayilarimgs[skor.puan].width, sayilarimgs[skor.puan].height);
				}
				else if (skor.puan.toString().length == 2)
				{
					ctx.drawImage(sayilarimgs[parseInt(skor.puan.toString()[0])], 55, 55, sayilarimgs[parseInt(skor.puan.toString()[0])].width, sayilarimgs[parseInt(skor.puan.toString()[0])].height);
					ctx.drawImage(sayilarimgs[parseInt(skor.puan.toString()[1])], 135, 55, sayilarimgs[parseInt(skor.puan.toString()[1])].width, sayilarimgs[parseInt(skor.puan.toString()[1])].height);
				}
				else if (skor.puan.toString().length == 3)
				{
					ctx.drawImage(sayilarimgs[parseInt(skor.puan.toString()[0])], 55, 55, sayilarimgs[parseInt(skor.puan.toString()[0])].width, sayilarimgs[parseInt(skor.puan.toString()[0])].height);
					ctx.drawImage(sayilarimgs[parseInt(skor.puan.toString()[1])], 135, 55, sayilarimgs[parseInt(skor.puan.toString()[1])].width, sayilarimgs[parseInt(skor.puan.toString()[1])].height);
					ctx.drawImage(sayilarimgs[parseInt(skor.puan.toString()[2])], 220, 55, sayilarimgs[parseInt(skor.puan.toString()[2])].width, sayilarimgs[parseInt(skor.puan.toString()[2])].height);
				}
				else if (skor.puan.toString().length == 4)
				{
					ctx.drawImage(sayilarimgs[parseInt(skor.puan.toString()[0])], 55, 55, sayilarimgs[parseInt(skor.puan.toString()[0])].width, sayilarimgs[parseInt(skor.puan.toString()[0])].height);
					ctx.drawImage(sayilarimgs[parseInt(skor.puan.toString()[1])], 135, 55, sayilarimgs[parseInt(skor.puan.toString()[1])].width, sayilarimgs[parseInt(skor.puan.toString()[1])].height);
					ctx.drawImage(sayilarimgs[parseInt(skor.puan.toString()[2])], 220, 55, sayilarimgs[parseInt(skor.puan.toString()[2])].width, sayilarimgs[parseInt(skor.puan.toString()[2])].height);
					ctx.drawImage(sayilarimgs[parseInt(skor.puan.toString()[3])], 300, 55, sayilarimgs[parseInt(skor.puan.toString()[3])].width, sayilarimgs[parseInt(skor.puan.toString()[3])].height);
				}
				
			}
		}
		}
		requestAnimationFrame(Ciz);
	}
		
	boyutuGuncelle();
	Kaynaklar();	
	
	var intid = setInterval(Guncelle, 2000);
		
	Ciz();
	
</script>
